import React, { useState, useEffect } from "react";
import axios from "axios";
import Table from "components/Table/Table.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import Card from "components/Card/Card.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardBody from "components/Card/CardBody.jsx";
import { Form, FormGroup, Label, Input, Button } from "reactstrap";
import "users";

function Users() {
  const [data, setData] = useState([]);
  const [addUserFormState, setAddUserFormState] = useState(false);
  useEffect(() => {
    (async () => {
      try {
        const result = await axios("http://localhost:8080/users");
        console.log(result.data);
        const usersData = result.data.map(item => [
          item.first_name,
          item.last_name,
          item.user_name,
          item.tasks,
          item.level
        ]);
        console.log(usersData);
        setData(usersData);
      } catch (e) {
        console.log(e);
      }
    })();
  }, []);

  const addUserFrame = () => {
    return (
      <Form className="add-user-form">
        <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
          <Label for="exampleEmail" className="mr-sm-2">
            Email
          </Label>
          <Input
            type="email"
            name="email"
            id="exampleEmail"
            placeholder="something@idk.cool"
          />
        </FormGroup>
        <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
          <Label for="examplePassword" className="mr-sm-2">
            Password
          </Label>
          <Input
            type="password"
            name="password"
            id="examplePassword"
            placeholder="don't tell!"
          />
        </FormGroup>
        <Button>Submit</Button>
      </Form>
    );
  };

  return (
    <GridContainer>
      {addUserFormState && addUserFrame()}
      <GridItem xs={12} sm={12} md={12}>
        <Card>
          <CardHeader color="primary">
            <h4>Users list</h4>
            <p>Information about all users</p>
          </CardHeader>
          <CardBody>
            <Table
              tableHeaderColor="primary"
              tableHead={[
                "First Name",
                "Last Name",
                "User name",
                "Tasks",
                "Level"
              ]}
              tableData={data}
            />
          </CardBody>
        </Card>
        <Button
          color="info"
          onClick={() => setAddUserFormState(!addUserFormState)}
        >
          Add user
        </Button>
      </GridItem>
    </GridContainer>
  );
}

export default Users;
